import React from "react";
import Cabecera from "./components/Cabecera";
import "./App.css";

function App() {
  function manejaClick() {
    console.log("He sido clickeado!!");
  }

  manejaClick = () => {
    console.log("He sido clickeado");
  };

  return (
    <div className="App">
      <Cabecera miau={"Bienvenido miau"} manejaClick={this.manejaClick} />
    </div>
  );
}

export default App;
